  return (
    <nav>
      <ul className='flex space-x-8 capitalize text-[15px]'>
        {navigation.map((item, idex) =>{
            return ( 
                <li className='text-white hover:text-accent cursor-pointer'></li>
            )
        })}
      </ul>
    </nav>
  )
}

export default Navbar
